      if (language) {
        loadLanguage(language);
      }

      block.type = 'pre';
      block.functionType = 'fencecode';
      block.lang = language;
      block.text = '';
      block.history = null;
      block.children = [];
      this.appendChild(codeBlock, codeContent);
      this.appendChild(block, inputBlock);
      this.appendChild(block, codeBlock);
